import React, { useState } from "react";
import "primereact/resources/primereact.min.css";
import { Card } from "primereact/card";
import { Button } from "primereact/button";
import "primeicons/primeicons.css";
import "primeflex/primeflex.css";
import "primereact/resources/themes/vela-blue/theme.css";
import { InputText } from "primereact/inputtext";

const SearchBar = () => {
  const [value, setValue] = useState("");
  return (
    <div>
      <div className="p-card">
        <span className="p-input-icon-left p-card-content">
          <i className="pi pi-search" />
          <InputText
            style={{ width: "800px" }}
            value={value}
            onChange={(e) => {
              setValue(e.target.value);
              console.log(e.target.value);
            }}
            placeholder="Search"
          />
          <Button icon="pi pi-search" />
        </span>
      </div>
      <div style={{ padding: 100 }}>
        <Card title="Simple Card" style={{ width: "75rem", margin: "auto" }}>
          <p className="p-m-0" style={{ lineHeight: "1.5" }}>
            {/* Lorem ipsum dolor sit amet, consectetur adipisicing elit. Inventore
          sed consequuntur error repudiandae numquam deserunt quisquam repellat
          libero asperiores earum nam nobis, culpa ratione quam perferendis
          esse, cupiditate neque quas! */}
            <iframe
              title="3d"
              className="pubchem-widget"
              src="https://pubchem.ncbi.nlm.nih.gov/compound/aspirin#section=3D-Conformer&fullscreen=true&embed=tre&hide_title=true&animate=true"
              style={{ width: "100%", height: "600px" }}
            ></iframe>
          </p>
        </Card>
      </div>
    </div>
  );
};

export default SearchBar;
